import React from 'react';
import map from './mapOfLocations.png';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={map} className="App-mapOfLocations" alt="mapOfLocations"/>
        <p>
          Select the companies you plan to visit!
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>

    </div>
  );
}

export default App;
